import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Play from '../../assests/play.png';					
import React, { Component } from 'react'
import { $ }  from 'react-jquery-plugin';
import { findDOMNode } from 'react-dom';
import AOS from 'aos';
import 'aos/dist/aos.css';

export default class bannerslider extends Component {


	function () {
		AOS.init({
			duration: 1500, // values from 0 to 3000, with step 50ms
			easing: 'ease', // default easing for AOS animations
			once: false, // whether animation should happen only once - while scrolling down
			mirror: false, // whether elements should animate out while scrolling past them
			debounceDelay: 100, // the delay on debounce used while resizing window (advanced)
		});
	}

	componentDidMount() {
		$('#homeslider')
			.on('beforeChange', function() {
					$('.slider_title').removeClass("aos-animate");
					$('.slider_subtitle').removeClass("aos-animate");
					$('.small_cta').removeClass("aos-animate");
					$('.big_cta').removeClass("aos-animate");
					// AOS.refreshHard(); this didn't work
			})
			.on('afterChange', function(event, slick, currentSlide) {
					$('.slider_title').addClass("aos-animate");
					$('.slider_subtitle').addClass("aos-animate");
					$('.small_cta').addClass("aos-animate");
					$('.big_cta').addClass("aos-animate");
					// AOS.refreshHard(); this didn't work
			});
	}
	render() {
		const settings = {
			dots: false,
			infinite: true,
			speed: 2000,
			slidesToShow: 1,
			slidesToScroll: 1,
			autoplay: true,
			speed: 2000,
			beforeChange: function () {
				$('.stock_txt-content').addClass('fade-up')
			},
			afterChange: this.handleAfterChange
		};
		
		return (
			<>
				<div className="banner-slider-sec">
					<Slider {...settings}>
						<div className="stock_sec_image">
							<div className="container stck-cont-pst">
								<div className="stock_txt-content" data-aos="fade-up" data-aos-delay="300">
									<span>01</span>
									<h2>Driven to make experiences that cut through the noise</h2>
									<p>Feugiat fermentum eget suscipit sollicitudin molestie es posuere maecenas facili sis elit integer. Cras habitant quisque pellentesque pellentesque aliquam.</p>
									<div className="stock-video-description">
										<span><img src={Play} className="play-btn"  alt="play-btn"/></span><p>Featured Insighs</p> 
									</div>
								</div>
							</div>
						</div>
						<div className="stock_sec_image2">
							<div className="container stck-cont-pst">
								<div className="stock_txt-content" data-aos="fade-up" data-aos-delay="300">
									<span>02</span>
									<h2>Driven to make experiences that cut through the noise</h2>
									<p>Feugiat fermentum eget suscipit sollicitudin molestie es posuere maecenas facili sis elit integer. Cras habitant quisque pellentesque pellentesque aliquam.</p>
									<div className="stock-video-description">
										<span><img src={Play} className="play-btn"  alt="play-btn"/></span><p>Featured Insighs</p> 
									</div>
								</div>
							</div>
						</div>
						<div className="stock_sec_image3">
							<div className="container stck-cont-pst">
								<div className="stock_txt-content" data-aos="fade-up" data-aos-delay="300">
									<span>03</span>
									<h2>Driven to make experiences that cut through the noise</h2>
									<p>Feugiat fermentum eget suscipit sollicitudin molestie es posuere maecenas facili sis elit integer. Cras habitant quisque pellentesque pellentesque aliquam.</p>
									<div className="stock-video-description">
										<span><img src={Play} className="play-btn"  alt="play-btn"/></span><p>Featured Insighs</p> 
									</div>
								</div>
							</div>
						</div>
					</Slider>
				</div>
			</>
		)
	}
}
